function react(polymer) {
    const stack = [];
    for (let i = 0; i < polymer.length; i++) {
        const unit = polymer[i];
        if (stack.length === 0) {
            stack.push(unit);
        } else {
            const prevUnit = stack.pop();
            if (unit.toLowerCase() === prevUnit.toLowerCase() && unit !== prevUnit) {
                continue;
            } else {
                stack.push(prevUnit);
                stack.push(unit);
            }
        }
    }

    return stack.join('');
}

